text:
I was being blocked from dropping my tables in MySQL because they all had foreign keys with each other, but if you execute this little group of text, it will drop all of them at once.
SET FOREIGN_KEY_CHECKS = 0;
drop table if exists fridge;
drop table if exists user;
drop table if exists beer;
SET FOREIGN_KEY_CHECKS = 1;

